private void copyFile(File src, File dst) throws IOException {
  BufferedReader in = new BufferedReader(new FileReader(src));
  Writer out = new FileWriter(dst);

  for (String line = in.readLine(); null != line; line = in.readLine()) {
    out.write(line);
  }
  in.close();
  out.close();
}

